.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"512835","type":"CustomJS"},{"attributes":{"editor":{"id":"513017"},"field":"Avg. Trade Duration","formatter":{"id":"513016"},"title":"Avg. Trade Duration"},"id":"512956","type":"TableColumn"},{"attributes":{},"id":"513007","type":"StringEditor"},{"attributes":{"source":{"id":"512927"}},"id":"512944","type":"CDSView"},{"attributes":{},"id":"512992","type":"StringFormatter"},{"attributes":{},"id":"513017","type":"StringEditor"},{"attributes":{"data":{"Close":{"__ndarray__":"AAAAANj0VEEAAAAAH9VUQQAAAACt71RBAAAAQGMJVUEAAACASwRVQQAAAMDNV1VBAAAAALxcVUEAAABArV9VQQAAAAB7VlVBAAAAANCDVUEAAABAqbxVQQAAAEApsFVBAAAAAPNHVUEAAADAQR9VQQAAAADcNFVBAAAAAI6bVEEAAADAEwhUQQAAAEDsO1RBAAAAQOtPVEEAAADAJFdUQQAAAEDLhVRBAAAAADyDVEEAAABAsl9UQQAAAAC07lRBAAAAQPreVEEAAACASvJUQQAAAACv9FRBAAAAgPJoVEEAAADAQydVQQAAAICCPFVBAAAAgBJAVUEAAADA/ktVQQAAAAB3fVVBAAAAAG0XVUEAAADAtrtUQQAAAAA/o1RBAAAAQGi7VEEAAADADFZUQQAAAMD7cFRBAAAAQBQiVEEAAABAy1NUQQAAAMAFIlRBAAAAAD4dVEEAAAAAjSZUQQAAAABIdVRBAAAAACZrVEEAAADARkFUQQAAAAB7Y1RBAAAAgLTAVEEAAADAr7BUQQAAAMD3b1RBAAAAwFyFVEEAAACAC0JUQQAAAABBVFRBAAAAgC04VEEAAACApRpUQQAAAABU91NBAAAAwKb7U0EAAADAbC5UQQAAAAB/ZVRBAAAAQBmNVEEAAACAIwpVQQAAAAB/JlVBAAAAAKAOVUEAAABAAQxVQQAAAMAqXFVBAAAAQI9+VUEAAAAAqnFVQQAAAECRW1VBAAAAQM9PVUEAAACAQVFVQQAAAADgMVVBAAAAQNwXVUEAAAAAuhBVQQAAAEBoFlVBAAAAAEpGVUEAAADAv1dWQQAAAMDeGVZBAAAAAJZEVkEAAACA1jxWQQAAAADqT1ZBAAAAgC8rVkEAAACAU2hWQQAAAAAjM1ZBAAAAAAg9VkEAAAAADDZWQQAAAMC9KFZBAAAAgLYuVkEAAACA+TVWQQAAAECeIVZBAAAAALywVUEAAADAkMhVQQAAAEB3x1VBAAAAwKjjVUEAAAAAMflVQQAAAEBrJlZBAAAAAC9GVkEAAABAHS9WQQAAAIACNFZBAAAAwCiGVkEAAADA3Y9WQQAAAAA+QlZBAAAAALvFVUEAAAAA7Y1VQQAAAACUjVVBAAAAwLRwVUEAAABAAOFUQQAAAICe41RBAAAAQLcLVUEAAAAA7uVUQQAAAEAI51RBAAAAQIACVUEAAADAjapUQQAAAMCWRFRBAAAAAE95VEEAAADAVq1UQQAAAABV0FRBAAAAgGTOVEEAAACARf1UQQAAAECirFRBAAAAAIK4VEEAAABArJxUQQAAAMBbEVVBAAAAAAcAVUEAAACA6jRUQQAAAICcZ1RBAAAAAMeVVEEAAADA9qxUQQAAAEBGnFRBAAAAgKbKVEEAAADAOshUQQAAAMC
